import React from 'react';

const Ranks =({name, entries})=>{
    return(
        <div>
            <div className='white f3'>
            {`${name}, twoja ranga na ten moment to `}
            </div>

            <div className='white f1'>
            {entries}
            </div>
        </div>
    )
}
export default Ranks;
